import "./App.css";
import NavBar from "./components/NavBar";

function App() {
  return (
    <div className="px-50">
      <NavBar />
      <img
        src="images/Hero.jpg"
        alt="Fit to screen"
        className="w-full h-screen object-cover"
      />
    </div>
  );
}

export default App;
